import techniquesMindMap from '../components/203.png'
import knowledgeAreaAndTasks from '../components/202.png'
import s2 from '../components/203.png'
import Card from '../components/Card'
import SimpleCard from '../components/Card'


function FavoritesPage() {
    return (
    <div>Favorites Page
        <div>
            <SimpleCard category="category" title="title" description="this is descriptive I mean very descriptive text" type="type"/>
            <SimpleCard description={techniquesMindMap} />
            <img src="./201.png"/>
        </div>
        
    </div>
    );
    
}

export default FavoritesPage;
